class CLEnablementStatusManager {
  constructor() {
    this.status = true;
  }

  getStatus() {
    return this.status;
  }

  setStatus(status) {
    this.status = status;
  }
}

const _CLEnablementStatusManager = new CLEnablementStatusManager();

module.exports.CLEnablementStatusManager = _CLEnablementStatusManager;
